export interface Population {
    ID: number;
    Country: string;
    Year: number;
    TotalMale: string;
    TotalFemale: string;
}




export function fetchData(): Promise<Population[]> {
    const dataUrl =
        "https://localhost:7185/Population";
    return fetch(dataUrl)
        .then((r) => r.json())
}
